float mySine(float theta)
{
    //return sin(theta);

    static float mul=SINE_TABLE_SIZE/(2.*PI);
    static int mask=SINE_TABLE_SIZE-1;

    if (theta<0)
        return -sineTable[ (int)(-theta*mul )&mask];//%SINE_TABLE_SIZE ];
    else return sineTable[ (int)( theta*mul )&mask];//%SINE_TABLE_SIZE ];

}

float myCosine(float theta)
{
    static float PI_2=PI/2.f;

    return  mySine(theta +PI_2);
}
